class Todo extends Component {
  render() {
    return(
      <div className="Todo">
	<h2>我是首页</h2>
	<h3>欢迎{this.props.name}</h3>
	<a href="/login">登录</a>
	<a href="/register">注册</a>
      </div>
    );
  }
}

export default Todo;
